import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AuthenticationComponent } from './shared/components/authentication/authentication.component';
import { DashboardComponent } from './admin/components/dashboard/dashboard.component';
import { ListaclientesComponent } from './admin/components/listaclientes/listaclientes.component';
import { HttpClient, HttpClientModule } from '@angular/common/http';
import { ReactiveFormsModule } from '@angular/forms';
import { EditarproyectoComponent } from './admin/components/editarproyecto/editarproyecto.component';
import { CrearproyectoComponent } from './admin/components/crearproyecto/crearproyecto.component';
import { ListarproyectosComponent } from './admin/components/listarproyectos/listarproyectos.component';
import { VerproyectoComponent } from './admin/components/verproyecto/verproyecto.component';

@NgModule({
  declarations: [
    AppComponent,
    AuthenticationComponent,
    DashboardComponent,
    ListaclientesComponent,
    EditarproyectoComponent,
    CrearproyectoComponent,
    ListarproyectosComponent,
    VerproyectoComponent,

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    ReactiveFormsModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
